判决说理部分：本院认为，焦作中旅银行与郑州海创公司签订的《委托贷款委托合同》、与重庆凯拉姆特公司签订的《委托贷款借款合同》、与韩光云、重庆喜福公司签订的《保证合同》、与重庆泰正公司签订的《最高额抵押合同》均合法有效。重庆泰正公司提供的抵押房产办理了抵押登记手续，并取得了不动产登记证明。重庆凯拉姆特公司未按约定偿还委托贷款本息，已构成违约。韩光云、重庆喜福公司作为保证人，应当承担连带清偿责任。焦作中旅银行已按照合同约定将贷款发放给重庆凯拉姆特公司，重庆凯拉姆特公司未按合同约定偿还借款本息，应当承担违约责任。重庆泰正公司提供的抵押房产办理了抵押登记手续，并取得了不动产登记证明。重庆泰正公司以其名下的土地房屋为重庆凯拉姆特公司借款提供抵押担保，并办理了抵押登记手续，焦作中旅银行有权以该房产优先受偿。
综上所述，焦作中旅银行的诉讼请求，本院予以支持。依照《中华人民共和国合同法》第一百零七条、第二百零五条、第二百零六条、第二百零七条，《中华人民共和国物权法》第一百七十九条、第一百八十条、第一百八十七条、第一百九十八条、第二百零八条，《中华人民共和国担保法》第十八条、第二十一条，《中华人民共和国民事诉讼法》第六十四条，《最高人民法院关于适用〈中华人民共和国民事诉讼法〉的解释》第九十条，判决:一、被告重庆凯拉姆特公司在本判决生效后十日内向原告焦作中旅银行股份有限公司偿还借款本金16000万元，并支付利息1263.5万元，以及从2017年8月20日起至实际清偿之日止的逾期利息(按年利率11.7%计算);
二、原告焦作中旅银行股份有限公司对被告重庆泰正公司名下的位于重庆市南岸区南滨路76号第3、25、26、32至39层的房屋享有优先受偿权;
三、被告韩光云、重庆喜福公司对本判决第一项确定的债务承担连带清偿责任;
四、驳回原告焦作中旅银行股份有限公司的其他诉讼请求。
如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条的规定，加倍支付迟延履行期间的债务利息。
案件受理费114714元，由被告重庆凯拉姆特公司、重庆泰正公司、韩光云、重庆喜福公司负担。

判决说理部分：本院认为，原告与被告签订的《商品房买卖合同(预售)》、《百嘉信【壹品E•PARK】商品房认购书》均合法有效，双方应按照合同约定履行各自的义务。《商品房买卖合同(预售)》约定，被告应当在2017年8月30日前将作为本合同标的物的房屋交付原告使用，并办理产权证。根据本案查明的事实，被告至今未能将涉案房屋交付原告，亦未能办理涉案房屋的产权证，其行为已构成违约，应当承担违约责任。原告请求解除《商品房买卖合同(预售)》及《百嘉信【壹品E•PARK】商品房认购书》的诉讼请求，符合法律规定，本院予以支持。
关于原告主张的租金损失，因原告未能举证证明其与克洛维公司之间的租赁合同的真实性及租金损失，且克洛维公司亦未到庭陈述相关情况，故本院对原告主张的租金损失不予支持。
关于违约金，根据《商品房买卖合同(预售)》的约定，原告要求被告支付违约金的诉讼请求，符合法律规定，本院予以支持。
综上所述，依照《中华人民共和国合同法》第九十四条、第九十六条、第九十七条、第一百零七条、第一百一十四条，《中华人民共和国民事诉讼法》第六十四条第一款，判决：一、解除原告与被告签订的《商品房买卖合同(预售)》及《百嘉信【壹品E•PARK】商品房认购书》;
二、被告于本判决发生法律效力之日起十日内，向原告返还已付购房款人民币439725元及利息(以439725元为基数，自2017年8月30日起按中国人民银行公布的同期同类贷款利率计算至实际清偿之日止);
三、被告于本判决发生法律效力之日起十日内支付违约金人民币10000元;
四、驳回原告其他诉讼请求。

判决说理部分：本院认为，本案系劳动合同纠纷。原告提出诉求，请求判令被告支付原告停工工资、有薪年假工资、加班费、社会保险、解除劳动合同经济补偿金、律师费。被告未答辩。经审理原告的工资由基本工资和计件工资组成，计件工资是根据原告的工作量或者工作成果来确定的，是原告劳动报酬的组成部分，原告在职期间未向被告提出计件工资低于最低工资标准的异议，且原告的工资在2010年12月及2011年1月期间均超过最低工资标准，被告不存在未及时足额支付劳动报酬的情形。另外，原告在职期间，被告未为原告缴纳社会保险，被告应予补缴。根据《中华人民共和国劳动合同法》第二十八条、第三十八条、第四十六条、第四十七条、第五十条、《中华人民共和国劳动合同法实施条例》第二十七条、《中华人民共和国民事诉讼法》第六十四条第一款、第一百四十四条的规定，判决如下：
一、被告应于本判决生效之日起三日内向原告支付解除劳动合同经济补偿金人民币5360元;
二、被告应于本判决生效之日起三日内为原告补缴2009年3月至2011年2月的社会养老保险;
三、驳回原告其他诉讼请求。
如果被告未按本判决指定的期间履行给付金钱义务，应当加倍支付迟延履行期间的债务利息。

判决说理部分：本院认为，原告与被告签订的《个人借款/担保合同》合法有效，双方均应按照合同约定履行各自的义务。原告已依约向被告发放贷款，但被告未按约定偿还借款本息，构成违约。被告田玉忠、蒋小艳系夫妻关系，该借款发生在婚姻关系存续期间，依照《中华人民共和国婚姻法》第十九条“夫妻可以约定婚姻关系存续期间所得的财产以及婚前财产归各自所有、共同所有或部分各自所有、部分共同所有。约定应当采用书面形式。没有约定或约定不明确的，适用本法第十七条、第十八条的规定”的规定，原告主张被告田玉忠、蒋小艳共同承担还款责任，于法有据，本院予以支持。
根据《中华人民共和国合同法》第九十六条“当事人一方依照本法第九十三条第二款、第九十四条的规定主张解除合同的，应当通知对方。合同自通知到达对方时解除。对方有异议的，可以请求人民法院或仲裁机构确认解除合同的效力”，原告于2016年12月9日向被告发出逾期贷款催收通知，被告田玉忠、蒋小艳仍未偿还借款，原告有权解除《个人借款/担保合同》。
根据《中华人民共和国合同法》第九十八条“合同的权利义务终止后，当事人应当遵循诚实信用原则，根据交易习惯履行通知、协助、保密、旧物回收等义务”的规定，合同解除后，被告应当按照合同约定偿还借款本息，并承担相应的违约责任。
原告主张的律师代理费符合双方合同约定，且未超过律师收费标准，本院予以支持。
综上所述，依照《中华人民共和国合同法》第九十六条、第九十八条、第一百零七条、第二百零五条、第二百零六条、第二百零七条，《中华人民共和国婚姻法》第十九条，《中华人民共和国民事诉讼法》第一百四十四条之规定，判决如下：
一、解除原告广西南宁中行与被告田玉忠、蒋小艳签订的编号B：按字邕行江南支行2013年0358号《个人借款/担保合同》;
二、被告田玉忠、蒋小艳共同偿还给原告借款本金1061052.79元、利息(含罚息)32635.94元;
三、被告田玉忠、蒋小艳共同向原告支付律师代理费45810元;
四、原告对被告田玉忠名下南宁市青秀区房屋拍卖、变卖所得价款享有优先受偿权。
案件受理费17039元，由被告田玉忠、蒋小艳负担。

判决说理部分：本案系房屋买卖合同纠纷。原告提出诉求，请求判令被告继续履行合同，并承担逾期交房的违约责任。被告辩称其已取得商品房预售许可证明，合同能够继续履行;被告王文辉辩称其非合同相对方，不应承担连带责任。被告龙脉公司为一人有限公司，被告王文辉为该公司的独资股东，王文辉未提交证据证明公司财产独立于其个人财产，应对公司债务承担连带责任。被告龙脉公司迟延履行主要债务，经催告后在合理期限内仍未履行，原告请求解除合同于法有据，予以支持。原告请求被告龙脉公司承担逾期交房的违约责任，予以支持。依照《合同法》第九十四条、第九十七条、第一百零七条、第一百一十四条，《公司法》第六十三条，《民事诉讼法》第六十四条第一款、第一百四十二条之规定，判决如下：
判决结果部分：一、解除原告杨利建与被告河北龙脉房地产开发有限公司签订的《小蜜蜂公馆项目购房协议书》;
二、被告河北龙脉房地产开发有限公司于本判决生效之日起十日内向原告杨利建返还购房款人民币290867元;
三、被告河北龙脉房地产开发有限公司于本判决生效之日起十日内向原告杨利建支付违约金人民币50000元;
四、被告王文辉对被告河北龙脉房地产开发有限公司的上述债务承担连带清偿责任;
五、驳回原告杨利建的其他诉讼请求。
如果未按本判决指定的期间履行给付金钱义务，应当依照《民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。

判决说理部分：本院认为：福川商贸公司与安庆独秀农村商业银行股份有限公司肖坑支行签订的《流动资金借款合同》，福川商贸公司与兴发担保公司签订的《关于提供保证担保的合同书》、《反担保抵押合同》，以及兴发担保公司与安庆独秀农村商业银行股份有限公司肖坑支行签订的《保证合同》均合法有效。合同签订后，安庆独秀农村商业银行肖坑支行已向福川商贸公司发放贷款，但福川商贸公司未按合同约定偿还借款本息，已构成违约，应承担违约责任。兴发担保公司为福川商贸公司提供担保后，福川商贸公司未按约支付担保费，已构成违约，应承担违约责任。潘宜长、胡小燕、施琼、吕春林、创名商贸公司、陈居律、陈居香、陈居康作为保证人，未履行保证责任，构成违约，应承担违约责任。依照《中华人民共和国合同法》第一百零七条、第二百零六条、第二百零七条、《中华人民共和国担保法》第十八条、第二十一条、第三十三条、第三十六条、《中华人民共和国民事诉讼法》第六十四条、第一百四十二条、《最高人民法院关于适用〈中华人民共和国民事诉讼法〉的解释》第九十条，判决:一、被告福川商贸公司于本判决生效后十日内偿还兴发担保公司代偿的借款本金及利息;
二、被告福川商贸公司于本判决生效后十日内向兴发担保公司支付担保费及利息;
三、被告潘宜长、胡小燕、施琼、吕春林、创名商贸公司、陈居律、陈居香、陈居康对上述第二项债务承担连带清偿责任;
四、驳回兴发担保公司的其他诉讼请求。

判决说理部分：本院认为，原告与被告签订的委托担保合同书合法有效，被告未按约定履行借款合同，造成原告代为清偿贷款本息，应当承担违约责任。同时保证人赵帅超、燕鹏应按照反担保合同的约定承担连带保证责任。原告请求被告支付保全费、律师费，于法有据，应予支持。依照《中华人民共和国合同法》第六十条、第一百零七条、第一百一十四条，《中华人民共和国担保法》第十八条、第二十一条，《中华人民共和国民事诉讼法》第一百四十四条的规定，判决:一、被告杨国全、赵进茹于本判决生效后十日内共同偿还原告代偿的借款本息100623.9元及利息(利息按年利率6.35%计算，自2019年5月14日起至202020年5月14日止);
二、被告杨国全、赵进茹于本判决生效后十日内共同支付原告律师费5000元、保全费1020元、保费500元;
三、被告赵帅超、燕鹏对本判决第一项、第二项债务承担连带清偿责任。
如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条的规定，加倍支付迟延履行期间的债务利息。
案件受理费2300元，由被告杨国全、赵进茹、赵帅超、燕鹏共同负担。

判决说理部分：本院认为，原告与被告签订的房屋买卖合同合法有效，双方应按合同约定履行各自的义务。合同中约定原告支付10000元定金，且该定金在办理贷款前支付，被告在收取定金后，双方未能按约定办理贷款手续，被告在微信中向原告妻子退还定金，可以认定被告同意解除房屋买卖合同，但被告在微信中只退还了10000元，故被告仍应返还原告10000元。关于房屋中介费10300元，因合同中约定由原告承担，故原告无权要求被告返还。关于房屋所有权人李祥成与被告李斌之间是否存在委托关系，因李祥成未出庭未予证明，本院不予认定。关于原告主张的利息损失，因合同解除系被告违约造成，被告应赔偿原告因合同解除产生的损失，故原告主张的利息损失，本院予以支持。综上，依照《中华人民共和国合同法》第九十三条、第九十七条、第一百零七条、第一百一十五条、《中华人民共和国民事诉讼法》第六十四条、第一百四十四条之规定，判决如下：

一、被告于本判决生效后十日内返还原告购房定金10000元;
二、被告于本判决生效后十日内赔偿原告利息损失1000元;
三、驳回原告其他诉讼请求。
如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。
案件受理费2550元，由被告承担。

判决说理部分：本院认为，本案系执行异议之诉。原告提出诉请，要求确认其对位于成都市青羊区青羊大道207号16栋2单元10楼1号的房屋享有所有权，并停止对该房屋的执行。经法院查明：
1. 原告龚斌、严杰系夫妻关系;
2. 龚斌、严杰对位于成都市青羊区青羊大道207号16栋2单元10楼1号的房屋系夫妻共同共有;
3. 龚斌、严杰不存在将该房屋赠与他人的意思表示;
4. 龚斌、严杰未将该房屋出售给廖杰，且龚斌与廖杰、曾丽就该房屋签订的《房产买卖合同》并未生效;
5. 龚斌、严杰未将该房屋出售给李小兰，且龚斌与李小兰就该房屋签订的《抵押借款合同》并未生效;
6. 龚斌、严杰对该房屋设立的抵押权系其对该房屋享有的担保物权。
综上所述，龚斌、严杰未将该房屋出售给廖杰、李小兰，法院作出的查封该房屋的执行行为损害了龚斌、严杰的合法权益，龚斌、严杰有权提起本案诉讼。依照《中华人民共和国民事诉讼法》第一百一十四条、第二百二十七条，《最高人民法院关于适用<中华人民共和国民事诉讼法>的解释》第三百一十一条，判决：
一、 原告龚斌、严杰对位于成都市青羊区青羊大道207号16栋2单元10楼1号的房屋享有共有权;
