判决说理部分：本院认为，中信银行济宁分行与沃尔华工程公司签订的《最高额抵押合同》、与沃尔华管业公司、金盛公司签订的《最高额保证合同》、与沃尔华公司、瑞中公司、杨慎伟、宋畹华签订的《最高额保证合同》、与新天地公司签订的《最高额保证合同》均合法有效。中信银行济宁分行与沃尔华工程公司签订的《流动资金贷款合同》合法有效，中信银行济宁分行已向沃尔华工程公司发放了借款，但沃尔华工程公司未能按合同约定偿还借款本金及利息，构成违约。中信银行济宁分行通过中信银行股份有限公司济南分行与资产公司签订《不良资产批量转让协议》，将涉案借款担保债权转让给资产公司，转让债权本金4000万元、利息1567122.72元。中信银行济宁分行对上述债权享有优先受偿权。沃尔华工程公司以其所有的净值为3568万元的机器设备为上述借款提供抵押担保，并办理了抵押登记。沃尔华管业公司、金盛公司、沃尔华公司、瑞中公司、杨慎伟、宋畹华、新天地公司为上述借款提供连带责任保证。依照《中华人民共和国合同法》第六十条第一款、第一百零七条、第二百零五条、第二百零六条、第二百零七条，《中华人民共和国担保法》第十八条、第二十一条，《中华人民共和国物权法》第一百七十九条，《中华人民共和国民事诉讼法》第一百四十四条的规定，判决:一、被告山东沃尔华工程机械有限公司于本判决生效之日起十日内偿还中信银行济宁分行借款本金4000万元、利息840033.35元、罚息456843.44元，合计4996196.89元;
二、原告中信银行股份有限公司济宁分行对被告沃尔华工程机械有限公司抵押的动产(抵押登记编号：济高工商抵登字XXX号)享有优先受偿权;
三、被告山东沃尔华管业股份有限公司、山东金盛矿业有限公司、山东瑞中矿业有限公司、杨慎伟、宋畹华、山东新天地房地产开发有限公司对本判决第一项确定的债务承担连带清偿责任;
四、驳回原告中信银行股份有限公司济宁分行的其他诉讼请求。

判决说理部分：本院认为，原告与被告张红芳之间签订的《借款合同》合法有效，双方应当按照约定履行各自的义务。原告已经按照合同约定向被告张红芳支付了借款，被告张红芳未按照合同约定偿还借款本息，应当承担违约责任。被告张红芳与被告周鲲系夫妻关系，根据《最高人民法院关于适用<中华人民共和国婚姻法>若干问题的解释(二)》第二十四条的规定，债权人就婚姻关系存续期间夫妻一方以个人名义所负债务主张权利的，应当按夫妻共同债务处理。因此，原告有权要求被告周鲲对被告张红芳的债务承担共同清偿责任。

综上所述，依照《中华人民共和国合同法》第六十条、第二百零六条、第二百零七条，《中华人民共和国民事诉讼法》第六十四条第一款、第一百四十四条，《最高人民法院关于适用<中华人民共和国婚姻法>若干问题的解释(二)》第二十四条的规定，判决如下：

一、被告张红芳、周鲲应于本判决生效之日起十日内偿还原告借款本金人民币8000000元;
二、被告张红芳、周鲲应于本判决生效之日起十日内支付原告借款利息(以8000000元为基数，按照月息2%的标准，自2013年11月4日起至2019年3月31日止);
